import React from 'react';
import Login from './login';
import { BrowserRouter } from 'react-router-dom';
import  {Routes,Route} from 'react-router-dom';


function UsersLogin() {
  return (


<div className='text-red-500 h-[100vh] flex justify-center items-center bg-cover' style={{ background: "black" }} >
<BrowserRouter>
    <Routes>
    <Route path="/" element={<Login />} />
    </Routes>

</BrowserRouter>
<h1 className="text-2xl font-bold underline">ghffbfd</h1>
</div>

  );
}

export default UsersLogin;
